import React from 'react';
import Cards from './Cards';
import data from "./data";
import './index.css';


const favCourse= "Webdevelopment";
const FavC = () =>{
    if(favCourse === "Webdevelopment"){}
    return(<Cards
        imgscr={data[0].imgscr}                
        category={data[0].category}
        name={data[0].name}
        link = {data[0].link}
    />)
}


const App = () =>{
    return(<>
        <FavC/>
    </>);
}

export default App;
